function increase() {
  count++
  console.log(count);
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App /> 
    <div className='container'>
    <h1>{count}</h1>
    <button onClick={increase} >+</button>
    </div>
  </React.StrictMode>
);

